import React from 'react';
import {Link} from 'react-router-dom';

const Login = () => {
    return (
      <main className="container mx-auto mt-5 md:mt-20 p-5 md:flex md:justify-center">
        <h1>Grupo 13</h1>
        <h1>Inicion Sesion</h1>
      </main>
    );
}

export default Login;
